import React, { useState } from 'react'
import { Text, View, StyleSheet, ImageBackground,Image,TouchableOpacity, Switch ,TextInput } from "react-native"
import * as Animatable from 'react-native-animatable';
import firebase from 'firebase/app';
import "firebase/auth";



const styles = StyleSheet.create({
    view: {
        width: '100%',
        height: '100%',
        flex: 1,    
        
    },
    fondo:{

        height:'100%',
        width: '100%',
        resizeMode:'contain',
        alignItems:'center',    
            
    },
    contenidotop:{
        flexDirection:'row',
        marginTop:'12%',
    },
    contenidotopL:{
        width:'50%',
        paddingLeft:'5%',
    },

    contenidotopR:{
        width:'50%',
        justifyContent:"center",
        paddingRight: '5%', 
    },
    txtconf:{
        fontSize: 20, 
        fontWeight: "700",
        color: "#4D1A70" ,

    },
    btn_auto:{
        width:150,

        backgroundColor: "#4D1A70",
        borderRadius: 15,
        marginTop:'2%',
        alignItems:"center"
    },
    txtbtn_auto:{
        color:'#FFF',
        fontSize: 20,
        
    },
  
    
    contes:{
        flexDirection:'row',
        marginTop:'50%',

    },
    contenidoL:{
        width:'50%',
        paddingLeft:'5%',
        justifyContent:'center'
    },
    textcantidad:{
        fontSize: 20, 
        fontWeight: "700",
        color: "#4D1A70" ,
    },

    contenidoR:{
        width:'50%',
        backgroundColor: "#4D1A70",
        borderRadius: 15,
        alignItems:"center",
        right: '15%',
        color:'white',
        paddingTop:'1%',
        paddingBottom:'1%',
        paddingLeft:'2%',
        paddingRight:'2%'
    },
    Inputcantidad:{
        color:'white'
        

    },
    contes2:{
        flexDirection:'row',
        marginTop:'10%',

    },
    contes3:{
        flexDirection:'row',
        marginTop:'10%',

    },

    btn_configurar:{
        width:200,
        height:35,
        backgroundColor: "#4D1A70",
        borderRadius: 15,
        marginTop:'15%',
        alignItems:"center",
        justifyContent:"center",
        left:"23%"
       
    },
    txtbtn_configurar:{
        color:'#FBBA00',
        fontSize: 20,
        fontWeight:'bold'
        
    },
   
    btn_finalizar:{
        width:200,
        height:40,
        backgroundColor: "#4D1A70",
        borderRadius: 15,
        marginTop:'15%',
        alignItems:"center",
        justifyContent:"center"
    },
    txtbtn_finalizar:{
        color:'#FBBA00',
        fontSize: 20,
        fontWeight:'bold'
        
    }

    
 
})



export default function Configuracion_botScreen({ navigation}) {
    const [isEnabled, setIsEnabled] = useState(false);
    const toggleSwitch = () => setIsEnabled(previousState => !previousState);
    // const [text, setText] = useState('Automatico')
    // if (isEnabled == true) {
    //     setText("Automatico")
    //     }
    //     else{
    //       setText("Manual")
    //     }
        
    
    return (
        <View style={styles.view}>
            <ImageBackground source={require('../Img/fondo_config_bot.png')} style={styles.fondo}>
                
                <View style={styles.contenidotop}>
                    <View style={styles.contenidotopL}>
                        <Text style={styles.txtconf}>Configuracion bot</Text>

                        <TouchableOpacity style={styles.btn_auto}>
                            <Text style={styles.txtbtn_auto}>Automatico</Text>
                        </TouchableOpacity>
                    </View>                    
                    <View style={styles.contenidotopR}>
                        <Switch
                            style={styles.btn_switch}
                            trackColor={{ false: "#767577", true: "#4D1A70" }}
                            thumbColor={isEnabled ? "#FBBA00" : "#FBBA00"}
                            ios_backgroundColor="#3e3e3e"
                            onValueChange={toggleSwitch}
                            value={isEnabled}
                        />
                    </View>
                    
                </View>
                    
                <View style={styles.contes}>
                    <View style={styles.contenidoL}>
                        <Text style={styles.textcantidad}>CANTIDAD</Text> 
                    </View>
                    <View style={styles.contenidoR}>
                        <TextInput styles={styles.Inputcantidad} color="white" placeholder="$" placeholderTextColor="#fff"/>
                    </View>

                </View>

                <View style={styles.contes2}>
                    <View style={styles.contenidoL}>
                        <Text style={styles.textcantidad}>PROFIT</Text> 
                    </View>
                    <View style={styles.contenidoR}>
                        <TextInput styles={styles.Inputcantidad} color="white" placeholder="%" placeholderTextColor="#fff"/>
                    </View>

                </View>      

                <View style={styles.contes3}>
                    <View style={styles.contenidoL}>
                        <Text style={styles.textcantidad}>PISOS</Text> 
                    </View>
                    <View style={styles.contenidoR}>
                        <TextInput styles={styles.Inputcantidad} color="white" placeholder="#" placeholderTextColor="#fff"/>
                    </View>

                </View>

                 <View>

                    <TouchableOpacity style={styles.btn_configurar}>
                        <Text style={styles.txtbtn_configurar}>CONFIGURAR</Text>
                    </TouchableOpacity>
                    
                    
                </View>  

                
                <View>

                    <TouchableOpacity style={styles.btn_finalizar}>
                        <Text style={styles.txtbtn_finalizar}>FINALIZAR</Text>
                    </TouchableOpacity>
                    
                    
                </View>   
                          

               

            </ImageBackground>

        </View>
    )
}
